        return txt.split()
    elif ',' in txt:
        return txt.split(',')
    else:
        return sum(1 for char in txt if char.isalpha() and ord(char) % 2 == 1)

def is_sorted(lst):
    for i in range(len(lst) - 1):
        if lst[i] > lst[i + 1] or lst.count(lst[i]) > 2:
            return False
    return True

def intersection(interval1, interval2):
    import math

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                return False
        return True

    start = max(interval1[0], interval2[0])
    end = min(interval1[1], interval2[1])
    if start <= end:
        length = end - start
        if is_prime(length):
            return "YES"
    return "NO"

def prod_signs(arr):
    if not arr:
        return None
    product_of_signs = 1
    sum_of_magnitudes = 0
    for num in arr:
        if num > 0:
            product_of_signs *= 1
        elif num < 0:
            product_of_signs *= -1
        sum_of_magnitudes += abs(num)
    return product_of_signs * sum_of_magnitudes

def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = [(grid[i][j], i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
    visited = set()

    while pq:
        cost, x, y, path = heappop(pq)
        if len(path) == k:
            return path
        if (x, y, len(path)) in visited:
            continue
        visited.add((x, y, len(path)))
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_path = path + [grid[nx][ny]]
                heappush(pq, (cost + grid[nx][ny], nx, ny, new_path))

def tri(n):
    def helper(n, memo):
        if n in memo:
            return memo[n]
        if n == 1:
            return 3
        if n % 2 == 0:
            result = 1 + n // 2
        else:
            result = helper(n - 1, memo) + helper(n - 2, memo) + helper(n + 1, memo)
        memo[n] = result
        return result

    memo = {}
    result = []
    for i in range(1, n + 2):
        if i not in memo:
            helper(i, memo)
        result.append(memo[i])
    return result

def digits(n):
    product = 1
    has_odd = False
    while n > 0:
        digit = n % 10
        if digit % 2 != 0:
            product *= digit
            has_odd = True
        n //= 10
    return product if has_odd else 0

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']' and stack:
            stack.pop()
            if not stack:  # If stack is empty after pop, it means there was a nested bracket.
                return True
    return False

