def can_arrange(arr):
    for i in range(len(arr) - 1, 0, -1):
        if arr[i] < arr[i - 1]:
            return i
    return -1

def largest_smallest_integers(lst):
    largest_negative = None
    smallest_positive = None
    for num in lst:
        if num < 0:
            if largest_negative is None or num > largest_negative:
                largest_negative = num
        elif num > 0:
            if smallest_positive is None or num < smallest_positive:
                smallest_positive = num
    return (largest_negative, smallest_positive)

def compare_one(a, b):
    """
    Create a function that takes integers, floats, or strings representing
    real numbers, and returns the larger variable in its given variable type.
    Return None if the values are equal.
    Note: If a real number is represented as a string, the floating point might be . or ,
    """
    def convert_to_float(x):
        if isinstance(x, str):
            x = x.replace(',', '.')
            return float(x)
        return x

    a_float = convert_to_float(a)
    b_float = convert_to_float(b)

    if a_float > b_float:
        return a
    elif b_float > a_float:
        return b
    else:
        return None

def is_equal_to_sum_even(n):
    if n < 8:
        return False
    return n % 2 == 0

def special_factorial(n):
    def factorial(x):
        if x == 0:
            return 1
        return x * factorial(x-1)

    if n == 0:
        return 1
    return factorial(n) * special_factorial(n-1)

def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

def words_in_sentence(sentence):
    words = sentence.split()
    prime_length_words = [word for word in words if is_prime(len(word))]
    return ' '.join(prime_length_words)

def specialFilter(nums):
    def is_odd(n):
        return n % 2 != 0

    def first_last_odd(n):
        n = abs(n)  # Handle negative numbers
        last_digit = n % 10
        first_digit = int(str(n)[0])
        return is_odd(first_digit) and is_odd(last_digit)

    count = 0
    for num in nums:
        if num > 10 and first_last_odd(num):
            count += 1
    return count

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()
    start = min(planets.index(planet1), planets.index(planet2))
    end = max(planets.index(planet1), planets.index(planet2))
